function sum(a,b){
    return `sum of two number is  ${a+b}` ;
}
function Sub(a,b){
    return `Sub of two number is  ${a-b}` ;
}
function Div(a,b){
    let div = a/b;
    div = div.toFixed
    return (`Div of two number is ' ${div}`) ;
}
function Mult(a,b){
    return `Mult of two number is  ${a*b}` ;
}

export {sum,Sub,Div,Mult};
